import axios from "axios";


const BASE_URL_ENDPOINT = "https://www.omdbapi.com/?apikey=9c538846";

export function getMovieDetails(movieName) {
  axios(BASE_URL_ENDPOINT+"&s="+movieName).then(({data})=>{
    let results =  data.Search;
    return results;
  }
  )
}
